/* ===========================================================================
   BBMM: Reset changelog
   - resets the changelog seen state to force it to reappear
=========================================================================== */
(async () => {
	try { 
      await game.settings.set("bbmm", "seenChangelogs", {});
      cl = await game.settings.get("bbmm", "seenChangelogs");
      console.log(cl);

      game.modules.get("bbmm")?.api?.openChangelogReport?.(); }
	catch (e) { ui.notifications.error("BBMM changelog API not found."); }
})();
